using System;
using System.Threading;
using System.Threading.Tasks;
using EdgeJs;
//using System.Windows.Forms;


public static class Snippet
{
	public static System.String func(System.String nameFromMagic)
	{		
        greetingName = nameFromMagic;
		var node = CallNode();

		return nodeResult;
	}
		public static System.String nodeResult;
		public static System.String greetingName;

        public static void SendGreeting()
        {
            var func = Edge.Func(@"
            return function (data, callback) {
                callback(null, 'Node.js says ""Hello, ' + data + '""');
            };
        ");

            var result = func(greetingName);
			nodeResult = result.Result.ToString();
            //MessageBox.Show(result.Result.ToString());
        }


        public static Task CallNode()
        {
            Task t = Task.Run(() => SendGreeting()); 
			t.Wait();
			return t;
        }
}

using System;
using System.Threading;
using System.Threading.Tasks;
using EdgeJs;
//using System.Windows.Forms;


public static class Snippet
{
	public static System.String func(System.Double num1, System.Double num2, System.String jsdir)
	{		
        payload = "{\"num1\":"+num1+",\"num2\":"+num2+"}";
		jsdirectory = jsdir.ToLower();

		var node = CallNode();

		return nodeResult;
	}

	public static System.String nodeResult;
	public static System.String payload;
	public static System.String jsdirectory;

    public static void AddNumbers()
    {

		var func = Edge.Func(
        "return require('" +
		jsdirectory +
		"addnumbers.js');"
		);

        var result = func(payload);
		nodeResult = result.Result.ToString();
        //MessageBox.Show(result.Result.ToString());
    }


    public static Task CallNode()
    {
        Task t = Task.Run(() => AddNumbers()); 
		t.Wait();
		return t;
    }
}
